import * as React from 'react';
// import { Route, Routes, Navigate } from 'react-router-dom';
import LoginForm from './components/LoginForm';
import MainContainer from './components/MainContainer';
import SignupForm from './components/SignupForm';

let MainContainer1 = (props: RouteComponentProps) => <MainContainer />
let SignupForm1 = (props: RouteComponentProps) => <SignupForm />
let LoginForm1 = (props: RouteComponentProps) => <LoginForm />


export default function App() {
  return (
    // <Routes>
    //   <Route path="/home" element={<MainContainer />} />
    //   <Route path="/signup" element={<SignupForm />} />
    //   <Route path="/" element={<LoginForm />} />
    //   <Route path="*" element={<Navigate to="/" />} />
    // </Routes>

    <Router>
    <MainContainer1 path="/home" />
    <SignupForm1 path="/signup" />
    <LoginForm1 path="/" />
    <MainContainer1 default />
  </Router>
  );
}
